const host = process.env.REACT_APP_HOST;

export const imageUploadRouter = `${host}/api/imageupload`;
export const videoUploadRouter = `${host}/api/videoupload`;
export const instanceSegmentationRouter = `${host}/api/segmentation`;
export const chatRouter = `${host}/api/chat`;
export const sceneGraphRouter = `${host}/api/scene-graph`;
